const Footer = () => {
  return (
    <div className="bg-dark">
      <div className="row">
        <p>
          Bollymore Tourist Office. Emmet Place, Kinsale, Co Cork, P17 C973 Tel:
          + 353 21 4298234
        </p>
        <h3 className="text-center">
          <i class="fa fa-facebook mx-3"></i>
          <i class="fa fa-instagram mx-3"></i>
          <i class="fa fa-twitter mx-3"></i>
          <i class="fa fa-youtube mx-3"></i>
        </h3>
        <div className="bg-dark text-white">
          <h5 className="my-3">COPYRIGHT Â© 2029 Bollywole Tourism</h5>
        </div>
      </div>
    </div>
  );
};

export default Footer;
